import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

// Import chart components
import { Pie } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  ArcElement,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(ArcElement, Tooltip, Legend);

const Reports = () => {
  const [reports, setReports] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [pieData, setPieData] = useState(null); // state for pie chart data
  const token = localStorage.getItem('token');
  const headers = { Authorization: `Bearer ${token}` };

  // Fetch reports on component mount
  useEffect(() => {
    axios.get('/api/reports', { headers })
      .then(res => {
        setReports(res.data);
        preparePieChart(res.data);
      })
      .catch(err => alert('Failed to fetch reports'));
  }, []);

  const handleSearch = async () => {
    try {
      const res = await axios.get(`/api/search/reports?query=${searchQuery}`, { headers });
      setReports(res.data);
      preparePieChart(res.data);
    } catch (err) {
      alert('Search failed');
    }
  };

  const preparePieChart = (reportsData) => {
    // Count how many reports have feedback vs. none
    const feedbackCount = { withFeedback: 0, withoutFeedback: 0 };
    reportsData.forEach(report => {
      if (report.prl_feedback && report.prl_feedback.trim() !== '') {
        feedbackCount.withFeedback++;
      } else {
        feedbackCount.withoutFeedback++;
      }
    });

    setPieData({
      labels: ['With Feedback', 'Without Feedback'],
      datasets: [
        {
          label: 'Feedback Status',
          data: [feedbackCount.withFeedback, feedbackCount.withoutFeedback],
          backgroundColor: ['#36A2EB', '#85ff63ff'],
        },
      ],
    });
  };

  return (
    <div className="container mt-5">
      <h3>Reports</h3>
      <input
        type="text"
        placeholder="Search reports..."
        className="form-control mb-3"
        value={searchQuery}
        onChange={(e) => setSearchQuery(e.target.value)}
      />
      <button onClick={handleSearch} className="btn btn-secondary mb-3">Search</button>
      
      {/* Existing table */}
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Week</th>
            <th>Date</th>
            <th>Lecturer</th>
            <th>Topic</th>
            <th>PRL Feedback</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {reports.map(report => (
            <tr key={report.id}>
              <td>{report.id}</td>
              <td>{report.week}</td>
              <td>{report.date}</td>
              <td>{report.lecturer_name}</td>
              <td>{report.topic_taught}</td>
              <td>{report.prl_feedback || 'None'}</td>
              <td>
                <a href={`/api/reports/${report.id}/excel`} className="btn btn-sm btn-info">Download</a>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Pie chart below the table */}
      {pieData && (
        <div className="mt-5">
          <h4>PRL Feedback Distribution</h4>
          <Pie data={pieData} options={{
            responsive: true,
            plugins: {
              legend: { position: 'bottom' },
            },
          }} />
        </div>
      )}
    </div>
  );
};

export default Reports;
